import React from "react"
import ReactDom from "react-dom/client"
import "./style.css"
import one from"./assets/images/One.jpeg"

const root=ReactDom.createRoot(document.getElementById("root"))

// component
function Navbar(){
  return(
    <div className="navbar" >
      <h1 className="navbarheading" >Perfumy</h1>
      <div className="navbarUl">
      <ul >
      <li><a href="#">Home</a></li>
        <li><a href="#">Product</a></li>
        <li><a href="#">Contact us</a></li>
        <li><a href="#">About us</a></li>
        </ul>
      </div>



    </div>
  )
}

// searchbr
function Searhbar(){
  return(
    <div className="search" >
      <input className="searchbar" type="text" placeholder="search"></input>
    </div>
  )
}
// products
function Products(){
  return(
    <div className="Box1">
      <img className="Img1" src={one}></img>
      <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Quam, vitae. Expedita eos vero dolores eaque optio nulla mollitia non dolore consequatur, harum repellendus voluptas sit qui! Fugit sint nesciunt officia?</p>
    </div>
  )
}

root.render(<div>
  <Navbar></Navbar>
  <Searhbar></Searhbar>
  <Products></Products>
</div>)
